import { BrowserRouter, Switch, Route } from "react-router-dom";
import { ToastContainer } from "react-toastify";

import { MainPage } from "./MainPage/MainPage";

export const Pages = () => {

  return (
    <BrowserRouter>
      <Switch>
        <Route path="/*" component={MainPage} />
      </Switch>
      <ToastContainer hideProgressBar={true} />
    </BrowserRouter>
  );
};
